'use strict';

const assert = require( 'assert' );
const seneca = require( 'seneca' )();

seneca
	.use( 'entity' )
	.use( require( './file-manager' ) )
	.error( assert.fail )
	.ready( function ( err ) {
		createFile();
	} );

function createFile () {
	let data = 'data:image/jpeg;base64,';

	seneca.act( { 'role' : 'files', 'cmd' : 'upload', 'data' : { 'Filedata' : data } }, function ( err, file ) {
		if ( err ) return console.log( err );

		console.log( file );
	} );
}
